
import { RGBELoader } from './loader/RGBELoader.js';

export default function CubeMap () {
	var self = this;
	this.type = 'CubeMap';

	this.LINK = 'null';
	this.EXPOSURE = -1;
	this.GAMMA = -1;

	this._link = 'nullXZ';
	this._exposure = this.EXPOSURE;
	this._gamma = this.GAMMA;


	this.exposureStart = -1;
	this.gammaStart = -1;


	this._activDiz = false;


	this._layer = 1;
	this.otherLayer = 31; // max 31

	this.renderer = undefined;
	this.scene = undefined;
	this.cubeCamera = new THREE.CubeCamera(1, 10000, 512);
	this.geometry = new THREE.SphereBufferGeometry(1500, 32, 32);
	this.mesh = new THREE.Mesh(this.geometry);
	this.loader =undefined
	
	this.loader = new RGBELoader();
	
	


	this.init = function (_renderer, _scene) {
		if (_renderer === undefined || _scene === undefined) return;
		this.renderer = _renderer;
		this.scene = _scene;
		this.scene.add(this.cubeCamera);
		this.scene.add(this.mesh);
		// this.mesh.visible = false;
		this.link = 'null';
	};



	this.setLayers = function (v) {
		self.mesh.layers.set(v);
		self.cubeCamera.layers.set(v);
		self.cubeCamera.traverse(function (child) {
			child.layers.set(v);
		});
	};


	this.upDate = function (_renderer) {
		
		this.setLayers(this.otherLayer);
		this.cubeCamera.update(_renderer || this.renderer, this.scene);
		this.setLayers(this._layer);
	};
	this.material = undefined;
	this.dragMaterial = function (m) {
		this.material = m;
		if (sahBig == m.sahMin) {
			this.mesh.material = m;
			this.upDate();
		}
	};

	this.arrMat = [];
	this.testBD = function (link) {
		for (var i = 0; i < this.arrMat.length; i++) {
			if (this.arrMat[i].linkMy == link) {
				return this.arrMat[i];
			}
		}
		return null;
	};

	var bbDD;
	var sahBig = 0;
	this.loadFun = function () {
		sahBig++;
		var sahMin = sahBig;
		var link = this._link + '';
		bbDD = this.testBD(this._link);
		
		if (bbDD != null) {
			bbDD.sahMin = sahBig;
			this.dragMaterial(bbDD);
		}
		if (this._link == 'null' || this._link == undefined) {
			var ll = 'data:image/jpeg;base64,';
			new THREE.TextureLoader().load(ll, onLoad1);
			return;
		}

		if (this._link.indexOf('.png') != -1 || this._link.indexOf('.jpg') != -1 || this._link.indexOf('.jpeg') != -1) {
			new THREE.TextureLoader().load(this._link, onLoad1);
			return;
		}
		if(this.loader==undefined){
			console.log("Подключи в загрущик RGBELoader токо если надо hdr загрузить!!!")
			return;
		}

		this.loader.load(this._link, onLoadHdr);

		function onLoad1 (texture) {
			texture.minFilter = THREE.LinearFilter;
			texture.magFilter = THREE.NearestFilter;
			texture.flipY = true;
			texture.wrapS = texture.wrapT = THREE.RepeatWrapping;
			texture.anisotropy = self.renderer.capabilities.getMaxAnisotropy();
			var material = new THREE.MeshBasicMaterial({
				map: texture,
				side: THREE.BackSide
			});
			material.linkMy = link;
			material.sahMin = sahMin;
			self.arrMat.push(material);
			self.dragMaterial(material);
		}


		function onLoadHdr (texture, textureData) {
			var material = new THREE.ShaderMaterial({
				uniforms: {
					tDiffuse: {
						type: 't',
						value: texture
					},
					exposure: {
						type: 'f',
						value: textureData.exposure
					},
					gamma: {
						type: 'f',
						value: textureData.gamma
					},
					offsetRepeat: {
						type: 'v4',
						value: new THREE.Vector4(0, 0, 1, 1)
					}
				},
				vertexShader: shaderHdr.vertex,
				fragmentShader: shaderHdr.fragment
			});
			texture.minFilter = THREE.LinearFilter;
			texture.magFilter = THREE.NearestFilter;
			// texture.generateMipmaps = true;
			texture.flipY = true;
			texture.wrapS = texture.wrapT = THREE.RepeatWrapping;
			texture.anisotropy = self.renderer.capabilities.getMaxAnisotropy();
			material.side = THREE.BackSide;
			material.linkMy = link;
			material.sahMin = sahMin;
			self.arrMat.push(material);
			self.dragMaterial(material);
			self.exposureStart = textureData.exposure;
			self.gammaStart = textureData.gamma;
			if (self._activDiz == true) { // принимаем дизай	нера
				self._exposure = textureData.exposure;
				self._gamma = textureData.gamma;
			}
		}

	};


	this.getTexture = function () {
		return this.cubeCamera.renderTarget.texture;
	};

	var shaderHdr = {
		vertex: [
			'uniform vec4 offsetRepeat;',
			'varying vec2 vUv;',
			'void main() {',
			'    // vUv  = uv;',
			'    vUv = uv * offsetRepeat.zw + offsetRepeat.xy;',
			'    gl_Position = projectionMatrix * modelViewMatrix * vec4(position, 3);',
			'}'
		].join('\n'),

		fragment: [
			'uniform sampler2D   tDiffuse;',
			'uniform float       exposure;',
			'uniform float       gamma;',
			'varying vec2  vUv;',
			'vec3 decode_pnghdr( const in vec4 color ) {',
			'    vec4 rgbcolor = vec4( 0.0, 0.0, 0.0, 0.0 );',
			'    if ( color.w > 0.0 ) {',
			'        float f = pow(2.0, 127.0*(color.w-0.5));',
			'        rgbcolor.xyz = color.xyz * f;',
			'    }',
			'    return rgbcolor.xyz;',
			'    /*',
			'    // remove gamma correction',
			'    vec4 res = color * color;',
			'    // decoded RI',
			'    float ri = pow( 2.0, res.w * 32.0 - 16.0 );',
			'    // decoded HDR pixel',
			'    res.xyz = res.xyz * ri;',
			'    return res.xyz;',
			'    */',
			'}',
			'void main() {',
			'    vec4 color = texture2D( tDiffuse, vUv );',
			'    color.xyz  = decode_pnghdr( color );',
			'    // apply gamma correction and exposure',
			'    //gl_FragColor = vec4( pow( exposure * color.xyz, vec3( 0.474 ) ), 1.0 );',
			'    // Perform tone-mapping',
			'    float Y = dot(vec4(0.30, 0.59, 0.11, 0.0), color);',
			'    float YD = exposure * (exposure/gamma + 1.0) / (exposure + 1.0);',
			'    color *= YD;',
			'    gl_FragColor = vec4( color.xyz, 1.0 );',
			'}'
		].join('\n')
	};
	this.debug = false;
}
Object.defineProperties(CubeMap.prototype, {
	link: {
		set: function (v) {
			if (this._link == v) return;
			this._link = v;
			this.loadFun();
		},
		get: function () {
			return this._link;
		}
	},
	activDiz: {
		set: function (v) {
			if (this._activDiz == v) return;
			this._activDiz = v;

		},
		get: function () {
			return this._activDiz;
		}
	},
	exposure: {
		set: function (v) {
			if (this._exposure == v) return;
			this._exposure = v;
			if (!this.material) return;
			if (this.material.uniforms == undefined) return;
			this.material.uniforms.exposure.value = v;
			this.upDate();
		},
		get: function () {

			return this._exposure;
		}
	},
	gamma: {
		set: function (v) {
			if (this._gamma == v) return;

			this._gamma = v;

			if (!this.material) return;
			if (this.material.uniforms == undefined) return;
			this.material.uniforms.gamma.value = v;
			this.upDate();
		},
		get: function () {
			return this._gamma;
		}
	},
	debug: {
		set: function (v) {
			if (this._debug == v) return;
			this._debug = v;
			this._layer = v ? 0 : 31;
			this.setLayers(this._layer);
		},
		get: function () {
			return this._debug;
		}
	}
});